St Trinian's 2: The Legend of Fritton's Gold (2009)

Verenigd Koninkrijk
Komedie / Avontuur
106 minuten

geregisseerd door Oliver Parker en Barnaby Thompson
met Rupert Everett, Colin Firth en David Tennant

St. Trinian, de beruchte meisjesschool, is weer eens vol van chaos en spanning. De school raakt verwikkeld in een strijd met een groep mannen om een waardevolle schat en de leider wil de meiden gedomineerd zien worden. De meiden van St Trinians zijn echter vastbesloten hen te slim af te zijn.


